"original": |2-
     If an RTSP agent does not support a particular method, it MUST return
     a 501 (Not Implemented) response code and the requesting RTSP agent,
     in turn, SHOULD NOT try this method again for the given agent/
     resource combination.  An RTSP proxy whose main function is to log or
     audit and not modify transport or media handling in any way MAY
     forward RTSP messages with unknown methods.  Note that the proxy
     still needs to perform the minimal required processing, like adding
     the Via header.
"fixed": |-
  If an RTSP agent does not support a particular method, it MUST return a 501 (Not Implemented) response code and the requesting RTSP agent, in turn, SHOULD NOT try this method again for the given agent/ resource combination.  An RTSP proxy whose main function is to log or audit and not modify transport or media handling in any way MAY forward RTSP messages with unknown methods.  Note that the proxy still needs to perform the minimal required processing, like adding the Via header.
"ko": |-
  RTSP 에이전트가 특정 방법을 지원하지 않는 경우 501(구현되지 않음) 응답 코드를 반환해야 하며(MUST) 요청하는 RTSP 에이전트는 주어진 에이전트/리소스 조합에 대해 이 방법을 다시 시도해서는 안 됩니다. 주요 기능이 기록 또는 감사이고 어떤 방식으로든 전송 또는 미디어 처리를 수정하지 않는 RTSP 프록시는 알 수 없는 방법으로 RTSP 메시지를 전달할 수 있습니다. 프록시는 Via 헤더 추가와 같은 최소한의 필수 처리를 수행해야 합니다.
